import {
  MatchingApi,
  ImageSource
} from '@regulaforensics/face-recognition-webclient/esm';

(async () => {
  const image = ""
  let apiBasePath = process.env.API_BASE_PATH || "http://localhost:5000/api"

  const api = new MatchingApi({basePath: apiBasePath});

  let request = {}
  request.images = [
      {type: ImageSource.DOCUMENT_PRINTED, data: image },
      {type: ImageSource.DOCUMENT_RFID, data: image }
  ]

  const response = await api.compare(request)

  // const status = response.status.complete;
  const status = response.status;
  const res = response.data.results[0];
  const similarityOfSameImages = res.similarity

  console.log("-----------------------------------------------------------------")
  console.log(`           Recognition Status: ${status}`)
  console.log(`           similarity: ${similarityOfSameImages}`)
  console.log("-----------------------------------------------------------------")

})();

